import { React, useEffect } from 'react';
import Graph from "./Components/Graph.js";
import Form from "./Components/Form.js";

const MainPage = () => {
    const [geoCode, setGeoCode] = useEffect('');

    return(
        <>
            <Form getGeoCode = { geoCode => setGeoCode(geoCode) } />
            <Graph /> 
        </>
    );


}
